import styled from "styled-components";


export const HeaderComponent = styled.header`
    display: flex;
    background-color: #999;
    width: 100%;
    justify-content: center;
    align-items: center;
    color: #fff;
    gap: 2rem;
    padding: 10px;


    h1{
        margin: 0;
        padding: 0;
    }

    img{
        width: 200px;
        height: auto;
    }

`;
